import {React, useState} from 'react';
const payInsurance = [
    {
        title: 'Full wage',
        id: 1,
    },
    {
        title: 'other',
        id: 0
    }
];

const Insurance = () =>{

    return(
        <section>
            <h4>Insurance</h4>
            <div>
                {payInsurance.map((item) =>{
                    return(
                        <div key={item.id}>
                            <label>{item.title}</label>
                            <input type='radio'/>
                        </div>
                    )
                })}
                <input/>
                <label>VND</label>
            </div>
            <div>
                <label>Minimum wage</label>
                <input type='text'></input>
                <label>VND</label>
                <label>Social</label>
                <input type='text'></input>
                <label>%</label>
                <label>Health</label>
                <input type='text'></input>
                <label>%</label>
                <label>Unemployed</label>
                <input type='text'></input>
                <label>%</label>
            </div>
            <div>
                <label>Region</label>
                <input type="radio"></input>
                <label>I</label>
                <input type="radio"></input>
                <label>II</label>
                <input type="radio"></input>
                <label>III</label>
                <input type="radio"></input>
                <label>IV</label>
            </div>
        </section>
    )
}
export default Insurance;
